import React from 'react';
import './Home.css';
const Home = () =>{
  return (
    <div className='Home' style={{
      display: 'flex',
      justifyContent: 'Right',
      alignItems: 'Right',
      height: '100vh'
    }}>
      <>
      <h3>Home!!</h3>
      </>
    </div>
  );
}
export default Home;
